// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

// import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract heap {
    // using SafeMath for uint256[];

    uint256[] public heap;

    function insert(uint256 _value) public {
        heap.push(_value);

        uint256 currentIndex = heap.length - 1;

        while (
            currentIndex > 1 && heap[currentIndex / 2] < heap[currentIndex]
        ) {
            (heap[currentIndex / 2], heap[currentIndex]) = (
                _value,
                heap[currentIndex] / 2
            );
        }

        currentIndex = currentIndex / 2;
    }

    function getHeap() public view returns (uint256[] memory) {
        return heap;
    }

    function getMax() public view returns (uint256) {
        return heap[1];
    }
}

