// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Arrays.sol";

contract Optimize {
    using Arrays for uint256[];
    uint256[] public points;

    function loopOver() external {
        for (uint256 i = 0; i < 10; i++) {
            points.push(i);
        }
    }

    function insert(uint256 node) external {
        points.push(node);
    }

    function getAllpoints() public view returns (uint256[] memory) {
        return points;
    }

    function findUpperBound_(uint256 element) external view returns (uint256) {
        uint256 Bound = points.findUpperBound(element);
        return Bound;
    }
}

